    render(){
        return(
            <nav className="NavbarItems">
                <h1 className="navbar-logo">DIIMPLE'S PHOTOGRAPHY</h1>
                <ul className="nav-menu">
                    <li>  
                      <a href="/">
                      <i className ="fa-solid fa-house-user"></i>
                      </a>
                        
                 </li>

                </ul>
            </nav>
        )
    }
}

export default Navbar;
